import { css, cx } from "@emotion/css";

const Header = () => {
  return (
    <div className="w-full h-[70px] 2xl:h-[140px] flex justify-between items-center px-5 2xl:px-12">
      <img
        src="/assets/icons/logo.svg"
        alt=""
        className="h-[55px] w-[58px] 2xl:h-[120px] 2xl:w-[127px]"
      />
      <div className="h-full justify-between items-center w-[980px] hidden 2xl:flex">
        <div
          className={cx(
            "w-[722px] h-[60px] flex text-blackText rounded-[30px]",
            css`
              box-shadow: 1px 1px 1px 1px #70707055;
            `,
          )}
        >
          <div
            className={cx(
              "w-[20%] h-full flex justify-center items-center rounded-l-[30px] text-white",
              css`
                background-image: linear-gradient(to right, #97c9d5, #d3e4e8);
              `,
            )}
          >
            TOP
          </div>
          <div className="w-[20%] h-full flex justify-center items-center">NEWS</div>
          <div className="w-[20%] h-full flex justify-center items-center">ABOUT</div>
          <div className="w-[20%] h-full flex justify-center items-center">SERVICE</div>
          <div className="w-[20%] h-full flex justify-center items-center">CONTACT</div>
        </div>
        <div
          className={cx(
            "w-[220px] h-[60px] rounded-[30px] flex justify-center items-center text-white",
            css`
              background-image: linear-gradient(to right, #d187a4, #e8bccd);
            `,
          )}
        >
          無料体験はこちら
        </div>
      </div>
      <div className="bg-primaryColor text-white w-[175px] h-[50px] rounded-[25px] flex justify-center items-center 2xl:hidden text-xs">
        公式サイトはこちら
      </div>
    </div>
  );
};
export default Header;
